import{_ as e,o as a,c as o,ag as i}from"./chunks/framework.Q1EpFJIG.js";const h=JSON.parse('{"title":"Audit logs","description":"","frontmatter":{},"headers":[],"relativePath":"administrator/auditlogs.md","filePath":"administrator/auditlogs.md"}'),r={name:"administrator/auditlogs.md"};function n(d,t,l,s,c,u){return a(),o("div",null,[...t[0]||(t[0]=[i('<h1 id="audit-logs" tabindex="-1">Audit logs <a class="header-anchor" href="#audit-logs" aria-label="Permalink to &quot;Audit logs&quot;">​</a></h1><p>Every change made within your Federated Directory environment is recorded and can be reviewed. We store this information in two different audit logs:</p><ul><li>General audit log</li><li>Directory audit log</li></ul><h2 id="general-audit-log" tabindex="-1">General audit log <a class="header-anchor" href="#general-audit-log" aria-label="Permalink to &quot;General audit log&quot;">​</a></h2><p>You can find this audit log directly in the main menu, but only if you have an administrator role. This audit log contains every change to the company information, profile, API key or groups.</p><h2 id="directory-audit-log" tabindex="-1">Directory audit log <a class="header-anchor" href="#directory-audit-log" aria-label="Permalink to &quot;Directory audit log&quot;">​</a></h2><p>Directory log contains information about all the changes made within that directory. For example: users that are created, modified or deleted and changes made to the configuration of the directory itself.</p><p>Such a log can be found within the directory edit view. To open it, first click on &#39;Directories&#39; menu item and then on one of the available directories. In provided view, you will find tab <strong>LOGS</strong>, next to the <strong>USERS</strong>, <strong>CONFIG</strong> and <strong>KEYS</strong>.</p>',8)])])}const m=e(r,[["render",n]]);export{h as __pageData,m as default};
